config.script:
data = self.parent.parent.getChild("Table").props.data
csv = system.dataset.toCSV(data, True)

if data.getRowCount() != 0:
	system.perspective.download('track_trace_history.csv', csv)
else:
	system.perspective.openPopup('ErrorModal', 'GlobalComponents/Modals/ErrorModal', params={'ErrorMessage': 'Please select data to generate file', 'ModalName': 'ErrorModal'})

config.expression:
runScript("mes.trace.sp.getFullPartHistory", 0, 
	if({view.params.PartId} = "" || {view.params.PartId} = "None", None, {view.params.PartId}), 
	if({view.custom.Label} = "" || {view.custom.Label} = "None", None, {view.custom.Label}), 
	if({view.custom.Workorder} = "" || {view.custom.Workorder} = "None", None, {view.custom.Workorder}),
	None,
	if({view.custom.Date.StartTime} = "None", None, {view.custom.Date.StartTime}),
	if({view.custom.Date.EndTime} = "None", None, {view.custom.Date.EndTime})
)
